/*
 * alive 값이 true이면 각 스레드는 무한 루프를 돌며 반복해서 일을 하고,
 * alive 값이 false가 되면 무한 루프를 빠져나와 스레드를 종료한다.
 */
bool alive = true;

/*
 * Reader 스레드는 같은 문자를 N번 출력한다. 예를 들면 <AAA...AA> 이런 식이다.
 * 출력할 문자는 인자를 통해 0이면 A, 1이면 B, ..., 등으로 출력하며, 시작과 끝을 <...>로 나타낸다.
 * 단일 reader라면 <AAA...AA>처럼 같은 문자만 출력하겠지만, critical section에서 reader의
 * 중복을 허용하기 때문에 reader가 많아지면 출력이 어지럽게 섞여서 나오는 것이 정상이다.
 */
void *reader(void *arg)
{
    int id, i;

    /*
     * 들어온 인자를 통해 출력할 문자의 종류를 정한다.
     */
    id = *(int *)arg;
    /*
     * 스레드가 살아 있는 동안 같은 문자열 시퀀스 <XXX...XX>를 반복해서 출력한다.
     */
    while (alive) {
        /*
         * 임계구역 시작
         */
        printf(RED"<"RESET);
        for (i = 0; i < N; ++i)
            printf("%c", 'A'+id);
        printf(RED">"RESET);
        /*
         * 임계구역 종료
         */
    }
    pthread_exit(NULL);
}

/*
 * Writer 스레드는 사람의 얼굴 이미지를 출력한다.
 * 이미지는 세 가지 종류가 있으며 인자를 통해 식별한다.
 * Writer가 임계구역에 있으면 다른 writer는 물론이고 어떠한 reader도 들어올 수 없다.
 * 만일 이것을 어기고 다른 writer나 reader가 들어왔다면 얼굴 이미지가 깨져서 쉽게 감지된다.
 */
void *writer(void *arg)
{
    int id, i;
    struct timespec req;

    /*
     * 들어온 인자를 통해 얼굴 이미지의 종류를 정한다.
     */
    id = *(int *)arg;
    /*
     * 이미지 출력을 천천히 하기 위해 한 줄 출력할 때마다 쉬는 시간을 1 나노초로 설정한다.
     */
    req.tv_sec = 0;
    req.tv_nsec = 1;
    /*
     * 스레드가 살아 있는 동안 같은 이미지를 반복해서 출력한다.
     */
    while (alive) {
        /*
         * 임계구역 시작
         */
        printf("\n");
        switch (id) {
            case 0:
                for (i = 0; i < L1; ++i) {
                    printf("%s\n", teresa[i]);
                    nanosleep(&req, NULL);
                }
                break;
            case 1:
                for (i = 0; i < L2; ++i) {
                    printf("%s\n", deniro[i]);
                    nanosleep(&req, NULL);
                }
                break;
            case 2:
                for (i = 0; i < L3; ++i) {
                    printf("%s\n", einstein[i]);
                    nanosleep(&req, NULL);
                }
                break;
            default:
                ;
        }
        /*
         * 임계구역 종료
         */
    }
    pthread_exit(NULL);
}

/*
 * 메인 함수는 RNUM 개의 reader 스레드를 생성하고, WNUM 개의 writer 스레드를 생성한다.
 * 생성된 스레드가 일을 할 동안 0.2초 동안 기다렸다가 alive의 값을 0으로 바꿔서 모든 스레드가
 * 무한 루프를 빠져나올 수 있게 만든 후, 스레드가 종료할 때까지 기다리고 메인을 종료한다.
 */
int main(void)
{
    int i;
    int rarg[RNUM], warg[WNUM];
    pthread_t rthid[RNUM];
    pthread_t wthid[WNUM];
    struct timespec req;

    /*
     * reader 스레드를 생성한다.
     */
    for (i = 0; i < RNUM; ++i) {
        rarg[i] = i;
        pthread_create(rthid+i, NULL, reader, rarg+i);
    }
    /* 
     * writer 스레드를 생성한다.
     */
    for (i = 0; i < WNUM; ++i) {
        warg[i] = i;
        pthread_create(wthid+i, NULL, writer, warg+i);
    }
    /* 
     * 출력량을 조절하기 위해 0.2초 기다렸다가 모든 스레드를 종료한다.
     */
    req.tv_sec = 0;
    req.tv_nsec = 200000000L;
    nanosleep(&req, NULL);
    /*
     * 모든 스레드가 루프를 빠져나갈 수 있게 alive를 끈다.
     */
    alive = false;
    /*
     * 모든 스레드가 끝날 때까지 기다렸다가 조인한다.
     */
    for (i = 0; i < RNUM; ++i)
        pthread_join(rthid[i], NULL);
    for (i = 0; i < WNUM; ++i)
        pthread_join(wthid[i], NULL);

    return 0;;
}
